import styled from "styled-components";

export const Container = styled.nav`
    background: gray;

`
export const Content = styled.ul`
    display:flex;
    justify-content: center;
    align-items: center;
    list-style: none;

    h1 {
        font-size: 45px;
        border-bottom: 1px solid black;
    }
    li{
        margin: 0 70px;
        cursor: pointer;
        background-color: yellow;
        height:100px;
        display: flex;
    }
    li:hover{
        border-bottom: 1px solid black;

    }

`
